import React from 'react';
import { BrowserRouter as Router, Link, Route, Switch } from 'react-router-dom';
import Inscription from './Components/Inscription';
import Connexion from './Components/Connexion';

function App() {
    return (
        <Router>
            <div>
                <nav>
                    <ul>
                        <li>
                            <Link to="./Components/Inscription">Inscription</Link>
                        </li>
                        <li>
                            <Link to="./Components/Connexion">Connexion</Link>
                        </li>
                    </ul>
                </nav>

                <Switch>
                    <Route path="./Components/Inscription" component={Inscription} />
                    <Route path="./Components/Connexion" component={Connexion} />
                </Switch>
            </div>
        </Router>
    );
}

export default App;


